import React from 'react'
import Footer from './Footer'
import Header from './Header'
import ItemCard from './ItemCard'
import './Realisations.css'

function Realisations() {
    return (
        <div>
            <div className="headerWrapper">
                <Header activetab={1}/>
                {/*
                <video autoplay="autoplay" loop>
                <source src="misouah.mp4" type="video/mp4"/>
                </video>*/}

                <div className="backBanner">
                <img src="./Slide-1.jpg"/>
                </div>
            </div>
            <div className="body">
                <div className="greenBox gre">
                    <h1>NOS REALISATIONS</h1>
                </div>
                <div className="listBox">

                    <ItemCard 
                    image="./Sans-titre-1.gif" 
                    imageOrder={2} 
                    button={true}
                    filename = "./GRILLE-TARIFAIRE-TOUMODI.pdf"
                    buttonClass="greenButton mar"
                    details={
                        {
                            "spanText": "",
                            "colorText": "20 villas déjà construire sur le projet de 200 villas de Toumodi",
                            "detailText": "Pour plus de détails sur la villa et la grille tarifaire :",
                            "colorClass": "greenText"

                        }
                    }

                    detailsOrder={1}/>
                    <ItemCard 
                    image="./Sans-titre-4-min.gif" 
                    imageOrder={2} 
                    details={
                        {
                            "spanText": "",
                            "colorText": "Immeuble R+4(2) à Yopougon Niangon",
                            "detailText": "",
                            "colorClass": "greenText"

                        }
                    }

                    detailsOrder={1}/>
                    <ItemCard 
                    image="./Sans-titre-4-min.gif" 
                    imageOrder={2} 
                    details={
                        {
                            "spanText": "",
                            "colorText": "Immeuble R+4(2) à Yopougon ananeraie",
                            "detailText": "",
                            "colorClass": "greenText"

                        }
                    }

                    detailsOrder={1}/>
                </div>
            </div>

            <Footer/>
        </div>
    )
}

export default Realisations
